import React from 'react';

class SeccionCarga extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            
        }

    }

    AgregarCamion = () =>{
        console.log("hola")
        let nuevoInput = this.state.inputCamiones.length + 1;
        this.setState( prevState => ({inputCamiones: prevState.inputCamiones.concat([nuevoInput])}))
    }

    render(){
        return(
            <div className="form-group row">
                <div className="col-5 text">
                    <h4>Helado</h4>
                </div>
                <div className="col-4 text">
                    <h4>Tamaño de cajas</h4>
                </div>
                <div className="col-3">
                    <h4>Cantidad</h4>
                </div>
                <div className="col-5 text-center">
                    <select name = "tamano"  className="custom-select" id="inputGroupSelect01">
                        {/*this.props.datos.map(dato => (<option key = {dato.id} id={dato.id} value= {dato.id}>{dato.nombre}</option>))*/}
                    </select>
                </div>
                <div className="col-4 text-center">
                    <select name = {this.props.nombre + this.props.nro}  className="custom-select" id="inputGroupSelect01">
                        <option id="-1" value="-1" >Seleccionar tamaño</option>
                        <option id="1" value="10" >Pequeña (10kg)</option>
                        <option id="2" value="20" >Mediana (20kg)</option>
                        <option id="3" value="50" >Grande (50kg)</option>
                    </select>
                </div>
                <div className="col-3 text-center">
                    <div className="input-group">
                        <input name = "cantidad" type="number" className="form-control" aria-label="Cantidad de cajas"></input>
                        <div className="input-group-append">
                            <span className="input-group-text">cajas</span>
                        </div>
                    </div>
                </div>
            </div>
                
        )
    }
}

export default SeccionCarga;
